// 绘制节点
function drawNode(x, y, name) {
    ctx.beginPath();
    ctx.arc(x, y, nodeRadius, 0, 2 * Math.PI);
    ctx.fillStyle = 'black';
    ctx.fill();
    ctx.closePath();

    // 显示节点名称
    ctx.font = '12px Arial';
    ctx.fillStyle = 'blue';
    ctx.fillText(name, x + nodeRadius + 2, y + nodeRadius);
}


// 绘制边
function drawEdge(from, to, value) {
    ctx.beginPath();
    ctx.moveTo(from.x, from.y);
    ctx.lineTo(to.x, to.y);
    ctx.strokeStyle = 'black';
    ctx.stroke();
    ctx.closePath();

    // 显示边界数值
    const midX = (from.x + to.x) / 2;
    const midY = (from.y + to.y) / 2;
    ctx.font = '12px Arial';
    ctx.fillStyle = 'red';
    ctx.fillText(value, midX, midY);
}

// 计算节点坐标
function getNodeCoordinates(column, row) {
    return {
        x: columnSpacing * (column + 1),
        y: rowSpacing * (row + 1),
    };
}

// 绘制节点
nodes.forEach(node => {
    const { x, y } = getNodeCoordinates(node.column, node.row);
    drawNode(x, y, node.name);
});

// 绘制边
edges.forEach(edge => {
    const fromNode = nodes.find(node => node.column === edge.from.column && node.row === edge.from.row);
    const toNode = nodes.find(node => node.column === edge.to.column && node.row === edge.to.row);

    if (fromNode && toNode) {
        const fromCoords = getNodeCoordinates(fromNode.column, fromNode.row);
        const toCoords = getNodeCoordinates(toNode.column, toNode.row);

        drawEdge(fromCoords, toCoords, edge.value);
    }
});
